uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- ASSETS ---
uniform sampler2D iChannel0; // Slot 0: Depth Map

// --- UNIFORMS ---
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_glow_intensity;

// --- GEOMETRY CONTROLS ---
uniform float u_depth_strength; // Range: 0.0 to 1.5 (Default: 0.5)
uniform float u_face_zoom;      // Range: 0.2 to 2.0 (Default: 0.6)
uniform float u_face_offset_y;  // Range: -0.5 to 0.5 (Default: 0.0)

out vec4 fragColor;

// --- CONSTANTS ---
#define MAX_STEPS 128
#define MAX_DIST 50.0
#define SURF_DIST 0.001

// --- BOX SDF ---
float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// --- MAPPING ---
float map(vec3 p) {
    // Defaults
    float pDepth = (abs(u_depth_strength) < 0.001) ? 0.5 : u_depth_strength;
    float pZoom  = (abs(u_face_zoom) < 0.001)      ? 0.6 : u_face_zoom;

    // 1. Base Shape: A VISIBLE SLAB
    // I made it thicker (0.05) so you can definitely see it
    float d = sdBox(p, vec3(0.8, 1.1, 0.05)); 
    d -= 0.02; // Round edges

    // 2. Texture Mapping
    vec3 p_mapped = p;
    p_mapped.y -= u_face_offset_y;
    vec2 uv = p_mapped.xy * vec2(pZoom, pZoom * 0.75) + vec2(0.5, 0.5);

    // 3. Displacement
    // Only apply on front face
    if (p.z > 0.0 && uv.x > 0.0 && uv.x < 1.0 && uv.y > 0.0 && uv.y < 1.0) {

        float h = texture(iChannel0, uv).r;

        // Edge Fading
        float fade = smoothstep(0.0, 0.1, uv.x) * smoothstep(1.0, 0.9, uv.x) *
                     smoothstep(0.0, 0.1, uv.y) * smoothstep(1.0, 0.9, uv.y);

        // PUSH OUTWARD
        d -= h * pDepth * fade;
    }

    return d;
}

// --- NORMALS ---
vec3 getNormal(vec3 p) {
    float d = map(p);
    vec2 e = vec2(0.002, 0.0);
    return normalize(vec3(d - map(p - e.xyy), d - map(p - e.yxy), d - map(p - e.yyx)));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Camera
    float camDist = max(u_camera_dist, 3.5);
    vec3 ro = vec3(sin(iTime * 0.5) * 1.5, 0.0, camDist);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0,1,0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd * max(u_fov, 0.8) + uv.x * right + uv.y * up);

    // Raymarch
    float t = 0.0;
    float d = 0.0;
    bool hit = false;

    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * t;
        d = map(p);
        if(d < SURF_DIST) { hit = true; break; }
        if(t > MAX_DIST) break;
        t += d * 0.5; 
    }

    vec3 col = vec3(0.0);

    if(hit) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        // Re-sample for color logic
        float pZoom = (abs(u_face_zoom) < 0.001) ? 0.6 : u_face_zoom;
        vec3 p_mapped = p; 
        p_mapped.y -= u_face_offset_y;
        vec2 mapUV = p_mapped.xy * vec2(pZoom, pZoom * 0.75) + vec2(0.5, 0.5);

        float h = 0.0;
        // Check bounds before reading
        if (p.z > 0.0 && mapUV.x > 0.0 && mapUV.x < 1.0 && mapUV.y > 0.0 && mapUV.y < 1.0) {
            h = texture(iChannel0, mapUV).r;
        }

        // --- CARBONITE STYLE ---
        vec3 metalCol = vec3(0.1, 0.12, 0.15); // Dark Metal
        vec3 faceCol = vec3(0.8, 0.9, 1.0);    // Bright Hologram

        // Mix based on height
        vec3 albedo = mix(metalCol, faceCol, pow(h, 2.0));

        float diff = clamp(dot(n, vec3(0.5, 1.0, 1.0)), 0.0, 1.0);
        float spec = pow(max(dot(ref, vec3(0,0,1)), 0.0), 32.0);

        col = albedo * diff;
        col += spec * 0.5;
        col += albedo * u_glow_intensity * 0.5;

    } else {
        // VISIBLE BACKGROUND GRID (To confirm shader is running)
        float grid = step(0.98, max(abs(sin(uv.x*20.0)), abs(sin(uv.y*20.0))));
        col = vec3(0.05, 0.05, 0.1) * (0.5 + 0.5 * grid);
    }

    col = pow(col, vec3(0.4545));
    fragColor = vec4(col, 1.0);
}
